  return (
    <main className="container-fluid" style={mainStyles}>
      <div className="row h-100">
        <div className="col-12">
          <h1>Título de la sección principal</h1>
          <p>Contenido de ejemplo...</p>
        </div>
      </div>
    </main>
  );
};

export default MainSection;
